import styles from './projects.module.css'

const Stack = dynamic(
    () => import('framer').then((mod) => mod.Stack),
    { ssr: false }
  )
  const Frame = dynamic(
    () => import('framer').then((mod) => mod.Frame),
    { ssr: false }
  )

const items = [{name:'Name project 1', type: "Type 1"}
                , {name:'Name project 2', type: "Type 2"}
                , {name:'Name project 3', type: "Type 3"}
                , {name:'Name project 4', type: "Type 4"}
                , {name:'Name project 5', type: "Type 5"}];

export default function ProjectsItems() {
    return (
        <Stack size={100} direction="horizontal" alignment="start" gap='40' distribution="start">

                {items.map(aItem => (

                <Frame backgroundColor='#180233' height={'50vh'} width={'40vh'} className={styles.project_item}>

                  <div className={styles.project_item_text}>
                    <h3>{aItem.name}</h3>
                    <h4>{aItem.type}</h4>
                  </div>

                  <img src='/Min_projects.png' alt='min' className={styles.img_min}></img>

                </Frame>

                ))}

        </Stack>
    );
}
